    [],nt"revision_timestamp": "2016-07-27T22:47:18.708471",nt"name": "a-narrative-report-mingo-national-wildlife-refuge-may-through-august-1952",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Mingo National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1952.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    furbearers, predators, rodents, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments and plantings. Resource
    management is outlined; topics include grazing and haying. A progress report on
    field investigations and applied research is also provided. The public relations
    section discusses recreational uses, Refuge visitors, Refuge participation, hunting,
    and fishing.  N-R forms are attached.",nt"license_title": "License Not Specified",nt"extras":
